import React from "react";
import { Route , Routes } from "react-router-dom";
import Home from "./pages/Home"
import Header from "./component/login/Header/Header";
const App=()=>{
  return(
    <>
  <Header/>
    <Routes>    
    <Route exact path="/" Component={<Home />}/>
    
  </Routes> 
    </>
  
  );
}
export default App;
